import React from 'react';
import './BusinessCard.css';
import { FaGithub, FaDiscord, FaYoutube } from 'react-icons/fa';
import { SiCplusplus, SiCsharp, SiPython, SiPhp, SiHtml5, SiJavascript, SiJava } from 'react-icons/si';
import { FaFlag } from 'react-icons/fa';

const BusinessCard = () => {
  return (
    <div className="business-card">
      <div className="card-content">
        <h1 className="alias">Cr1ppl3</h1>
        <h2 className="profession">Game-Enhancing Software Developer</h2>
        <p className="location">
          <FaFlag className="flag-icon" /> Sydney, Australia <FaFlag className="flag-icon" /> Born in South Africa
        </p>
        <div className="social-icons">
          <a href="https://github.com/Cr1ppl3" target="_blank" rel="noopener noreferrer"><FaGithub /></a>
          <a href="https://discord.com/Cr1ppl3" target="_blank" rel="noopener noreferrer"><FaDiscord /></a>
          <a href="https://youtube.com/Cr1ppl3" target="_blank" rel="noopener noreferrer"><FaYoutube /></a>
        </div>
        <div className="skills">
          <SiCplusplus className="skill-icon" />
          <SiCsharp className="skill-icon" />
          <SiPython className="skill-icon" />
          <SiPhp className="skill-icon" />
          <SiHtml5 className="skill-icon" />
          <SiJavascript className="skill-icon" />
          <SiJava className="skill-icon" />
        </div>
        <p className="freelance">Freelance Work Available</p>
        <div className="contact-info">
          <p>Email: cr1ppl3@developer.com</p>
          <p>Phone: +61 123 456 789</p>
        </div>
      </div>
    </div>
  );
};

export default BusinessCard;
